    false,nt"url": null,nt"notes": "In March 2012, WSI (Watershed Sciences,
    Inc.) was contracted by Woolpert, Inc. (Woolpert) to collect Light Detection and
    Ranging (LiDAR) data and digital imagery in the fall of 2012 for a portion of Bridge
    Creek, a tributary to the John Day River, in Central Oregon. Data were collected
    to aid Woolpert and NOAA Fisheries in assessing ongoing channel restoration projects
    along the stream. This report accompanies the delivered orthophotos and documents
    data acquisition procedures, processing methods, and results of all accuracy assessments.
    The LiDAR data and documentation was delivered on November 8, 2012.",nt"owner_org":
